    reflects the corrected receipt addressed in the last report (April Monthly). Susan
    Patrick had contributed a $1,000 check to NABPAC as an earmark to Wyoming Values
    PAC on 3/10/09. Wyoming Values PAC deposited the check on 3/18/09. On 3/23/09,
    NABPAC received an insufficient funds notice regarding Ms. Patrick's check. All
    of these activities were reflected in the April Monthly Report. Ms. Patrick then
    contributed another $1,000 to NABPAC as an earmark to Wyoming Values PAC to replace
    the insufficient funds check. This contribution was done via credit card on 4/10/09
    and is reflected in this report. However, there is no accompanying earmark on
    Schedule B of this report because the disbursement was already reported in the
    April Monthly Report. Please take this information into account when reviewing
    this report. Thank you.\n"
